records.addlTxt:
Defendant Chinenye N Diei in court with Attorney Nathan John Dineen.  David John Behm appeared for the State of Wisconsin.  Defendant enters a guilty plea to Count #1.  Court performs plea colloquy and finds Defendant guilty of Count #1.  Count #2 is dismissed by operation of law.  State gives sentencing recommendations.  Attorney Dineen makes statements regarding sentencing. NOTE:  Defendant has been approved for alcohol treatment court.  Defendant makes statements.  Court sentences the Defendant to the following:

COUNT #1:    IMPOSED AND STAYED SENTENCE OF:   

3 YEARS IMPRISONMENT 
  -  18 MONTHS OF INITIAL CONFINEMENT
  -  18 MONTHS OF EXTENDED SUPERVISION;

*D/L REVOCATION: 33 months.
*IGNITION INTERLOCK:  33 months.

TERM OF PROBATION:  3 YEARS;

CONDITIONS OF PROBATION:  
*AODA Assessment and follow through with any treatment recommended;
*Absolute Sobriety;  Random U.A.'s ; 
*No Use or Possession of alcohol or illegal drugs 
*No Use or Possession of prescription drugs without a valid prescription;
*Any valid prescription drugs must be taken only in the manner in which they are prescribed/sign releases.
*Inform Agent of all prescriptions
*Follow through with any treatment and/or counseling recommended by Agent;
*Maintain employment and/or combination of schooling 
*DNA sample to be provided if not yet previously done 
*90 days of Day Report Center consecutive to condition time.
*Attend Victim Impact Panel. Defendant to serve 30 days huber, consecutive, as penalty for failure to attend Victim Impact Panel.      

BLOOD DRAW FEE:  $24.00 (to be paid as a condition of probation - to be forward to City of Brookfield Police Department);

FINE:  $3,293.00 & $250.00 DNA surcharge (to be paid out of cash bail posted ($500.00) and remainder due as a condition of probation);

CONDITION TIME:  12 MONTHS (1st 60 DAYS STRAIGHT TIME), remaining time non-working hours with standard release conditions- to commence forthwith - LAST 60 DAYS STAYED FOR 90 DAYS DAY REPORT CENTER.  If Defendant successfully completes Day REport Center, the 60 Days of Huber stayed will be permanently stayed. 

Defendant is eligible for Challenge Incarceration Program.
Defendant is eligible for Substance Abuse Program.

Felony warnings, voting rights and firearms warnings given.
